In collaboration with menswear brand <a href="http://nordemhirst.com/" target="blank">Nordem Hirst</a>, the God of Fire Tie collaboration has been long underway. Bringing the best of both talents, designer <a href="http://www.emilywoudenberg.com">Emily Woudenberg</a> and Kallvis Gents bring their knowledge in menswear and accessories into one product. Resulting in a limited edition series of 4 different styles, these skinny ties are designed for the modern man who are obsessed with style and luxury. Using digitally printed cotton silk blend materials from the United States, each tie is then locally produced in Toronto, Canada. The Nordem Hirst X Woudenberg ties use quality materials, and are produced with the highest attention to detail. Measuring 60 inches long, and 2 1/4 inches wide at the very bottom, the tie is designed to be slim and stylish. 

Each tie comes with the Holy Guide to Ties instruction booklet, which gives diagramed instructions on how to tie 4 separate knots; the Four in Hand, the Windsor, the Half Windsor, and the Shell Knot. Designers Woudenberg and Gents were greatly inspired by classic greek sculpture and the lack of sleek by minimal ties.

